import '../App.css';
import Button from 'react-bootstrap/Button';

function Home() {
  return (
    <div>
        <header className='Home-header'>
            <h6 style={{marginLeft: 100}}>Транспонатор нот</h6>
            <div>
                <Button>Вход</Button>
                <Button style={{marginLeft: 15, marginRight: 100}}>Регистрация</Button>
            </div>
        </header>
        <main className='Home-body'>
            <h5 style={{marginTop: 30}}>Онлайн транспонирование нот</h5>
        </main>
        <footer>говно</footer>
    </div>
  );
}

export default Home;
